import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCirclePlus } from '@fortawesome/free-solid-svg-icons';

import InputComponent from './components/InputComponent';
import './App.css';


function App() {
  const tasks: any[] = [{title: 'skjflkd', description: 'fhdsjf', edit: true, state: 'CHECKED'}];

  const addTask = () => {
    tasks.push();
    console.log('chegou');
  }

  return (
    <div className="App">
      <header className="App-header">
        <div className='Content'>
          <p>LEMBRETES</p>
          <div className='List'>
            {tasks.length > 0 ? 
            tasks.map(({title, description, edit, state}, i) => (
              <InputComponent _todo={{title: 'jdshfkj'}} key={i}></InputComponent>
              )) :
              <p className='None'> Nenhum lembrete dispon√≠vel. </p>
            }
            <button className='Add-button' onClick={addTask}>
              <FontAwesomeIcon icon={faCirclePlus}></FontAwesomeIcon>&nbsp;
                Novo Lembrete
            </button>
          </div>
        </div>
      </header>
    </div>
  );
}

export default App;
